(1, 'ceva', 3, 'Getting Started with C++: Your First Steps into Systems Programming', 'Just a test article made about C++.', '<p>C++ is a powerful and versatile language used in everything from game engines to operating systems. It\'s fast, close to the hardware, and gives you full control over memory — making it a favorite for performance-critical applications.</p><h2>Why Learn C++?</h2><p>C++ teaches you how computers work under the hood. You\'ll learn how memory is managed, how the CPU executes your instructions, and how to structure efficient, scalable programs. It\'s also widely used in competitive programming, embedded systems, and real-time applications.</p><h2>First Steps</h2><p data-start=\"705\" data-end=\"745\">To start coding in C++, all you need is:</p>\r\n<ul data-start=\"747\" data-end=\"865\"><li data-start=\"747\" data-end=\"792\">\r\n<p data-start=\"749\" data-end=\"792\">A <strong data-start=\"751\" data-end=\"766\">text editor</strong> (like VS Code or CLion)</p>\r\n</li><li data-start=\"793\" data-end=\"830\">\r\n<p data-start=\"795\" data-end=\"830\">A <strong data-start=\"797\" data-end=\"809\">compiler</strong> (like GCC or MSVC)</p>\r\n</li><li data-start=\"831\" data-end=\"865\">\r\n<p data-start=\"833\" data-end=\"865\">A basic “Hello, World!” program:</p></li></ul><p><img style=\"width: 391px;\" src=\"data:image/png;base64,\" data-filename=\"Screenshot 2025-05-21 221539.png\"><br><br></p>', 2, 700, 1, 0, 1, 'jpg', '2025-04-19 19:32:20', '2025-05-21 19:17:26');
INSERT INTO `article` (`id`, `public_id`, `user_id`, `title`, `description`, `content`, `category`, `price`, `bought`, `likes_count`, `is_public`, `cover_extension`, `created_at`, `updated_at`) VALUES
(2, 'test2', 3, 'Did someone say Spaghetti Carbonara?', 'This dish is very beloved worldwide, even though its origin lies in beautiful Italy, and throughout this article, YOU will learn, in just 15 minutes, how to make it properly! And by that I mean making it the traditional, Italian way, without any caloric heavy cream added.', '<p>This dish is very beloved worldwide, even though its origin lies in beautiful Italy, and throughout this article, YOU will learn, in just 15 minutes, how to make it properly! And by that I mean making it the traditional, Italian way, without any caloric heavy cream added.</p><p><b>The <i>ingredients </i>needed are:</b></p><ul><li>eggs</li><li>spaghetti</li><li>guanciale: cured fatty pork, similar to bacon, which creates a creamy texture when combined with the eggs and pasta</li><li>pepper</li><li>salt (only for the pasta)</li><li>garlic (optional)</li><li>Parmigiano Reggiano: a premium parmesan with complex flavours which should be grated at home, right before adding it to the pasta</li></ul><h1>Let’s get cooking!!</h1><ol><li>Slice the meat into small pieces and grate the parmesan.</li><li>Add into a bowl the eggs, the parmesan, and some pepper, and whisk until it becomes a sauce.</li><li>Meanwhile, cook the spaghetti as instructed on the package and try not to break it! After the pasta is done, keep a quarter of the water for later and drain the rest.</li><li>While the pasta is cooking, start cooking the guanciale until golden, in a pan, but don’t add any oil since it has its own fat, and afterwards add the spaghetti to it. This will ensure that it gets coated in the meat’s fat, which creates the famous creamy texture we desire.&nbsp;</li><li>And now, for the final step, you have to add the water you saved earlier to the dish you have created and stir for 30 seconds, and…&nbsp;</li></ol><p><img style=\"width: 50%; float: left;\" src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2025-05-21 at 22.30.17_53b4974d.jpg\" class=\"note-float-left\"><img style=\"width: 50%; float: right;\" src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2025-05-21 at 22.30.41_0912047a.jpg\" class=\"note-float-right\"></p><h5>Surprise! The creamy spaghetti carbonara is done and ready to be eaten!</h5>', 6, 1200, 0, 0, 1, 'jpg', '2025-04-19 20:15:01', '2025-05-21 20:00:38');
INSERT INTO `article` (`id`, `public_id`, `user_id`, `title`, `description`, `content`, `category`, `price`, `bought`, `likes_count`, `is_public`, `cover_extension`, `created_at`, `updated_at`) VALUES
(7, 'f0c2648b-2076-11f0-b7d0-309c233d53c1', 3, ' Getting Started with HTML & CSS', 'HTML (HyperText Markup Language) and CSS (Cascading Style Sheets) are the foundational building blocks of the web.', '<p data-start=\"98\" data-end=\"220\"><strong data-start=\"98\" data-end=\"134\">HTML (HyperText Markup Language)</strong> and <strong data-start=\"139\" data-end=\"171\">CSS (Cascading Style Sheets)</strong> are the foundational building blocks of the web.</p>\r\n<ul data-start=\"222\" data-end=\"413\"><li data-start=\"222\" data-end=\"315\">\r\n<p data-start=\"224\" data-end=\"315\"><strong data-start=\"224\" data-end=\"232\">HTML</strong> gives structure to web pages — like headings, paragraphs, links, images, and more.</p>\r\n</li><li data-start=\"316\" data-end=\"413\">\r\n<p data-start=\"318\" data-end=\"413\"><strong data-start=\"318\" data-end=\"325\">CSS</strong> styles that structure — controlling layout, colors, fonts, spacing, and responsiveness.</p>\r\n</li></ul>\r\n<p data-start=\"415\" data-end=\"475\">Think of HTML as the bones, and CSS as the skin and clothes.</p><p data-start=\"415\" data-end=\"475\"><br></p><pre>&lt;!DOCTYPE html&gt;<br>&lt;html&gt;<br>&nbsp; &lt;head&gt;<br>&nbsp;&nbsp;&nbsp; &lt;style&gt;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; body { background-color: #f0f0f0; font-family: Arial; }<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; h1 { color: navy; }<br>&nbsp;&nbsp;&nbsp; &lt;/style&gt;<br>&nbsp; &lt;/head&gt;<br>&nbsp; &lt;body&gt;<br>&nbsp;&nbsp;&nbsp; &lt;h1&gt;Hello, world!&lt;/h1&gt;<br>&nbsp;&nbsp;&nbsp; &lt;p&gt;This is a simple HTML + CSS page.&lt;/p&gt;<br>&nbsp; &lt;/body&gt;<br>&lt;/html&gt;</pre><p><br></p><p data-start=\"415\" data-end=\"475\"></p><h5 data-start=\"415\" data-end=\"475\">With just a few lines, you can build clean, responsive websites — and it all starts with HTML and CSS.</h5>', 2, 500, 0, 0, 1, 'jpg', '2025-04-23 22:12:45', '2025-05-21 19:27:38'),
(8, 'e9dfe93e-210d-11f0-b7d0-309c233d53c1', 4, 'Orchids: Nature’s Exotic Masterpieces', '', '<p>Orchids are one of the largest and most diverse plant families on Earth, with over <strong data-start=\"187\" data-end=\"205\">25,000 species</strong> and more than <strong data-start=\"220\" data-end=\"239\">100,000 hybrids</strong>. Known for their stunning symmetry and vivid colors, orchids have fascinated botanists and flower lovers for centuries.</p><p><img style=\"width: 506.734px; height: 337.183px;\" src=\"https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwww.thespruce.com%2Fthmb%2FjI1wd2IKAwN5wplPhRVikDIxpRU%3D%2F2122x1412%2Ffilters%3Ano_upscale()%3Amax_bytes(150000)%3Astrip_icc()%2FCymbidiumOrchid-GettyImages-506065092-c5a8e2a0d48041ec8b91c6c245cb9461.jpg&amp;f=1&amp;nofb=1&amp;ipt=ffd76aa29c1d802e8f8b4afdc67148e3b91a31e2abea7fda465750b0182147fc\"></p><h2>What Makes Orchids Special?</h2><p>Unlike typical flowers, orchids have <strong data-start=\"430\" data-end=\"452\">bilateral symmetry</strong>, like a human face. Many species have evolved to attract specific pollinators — some even mimicking insects in shape and scent. They grow on trees (epiphytes), rocks, or in soil, depending on the species.</p><h2>Growing Orchids at Home</h2><p data-start=\"687\" data-end=\"795\">While they may seem delicate, many orchids (like the popular <strong data-start=\"748\" data-end=\"764\">Phalaenopsis</strong>) are quite hardy. They prefer:</p>\r\n<ul data-start=\"797\" data-end=\"900\"><li data-start=\"797\" data-end=\"817\">\r\n<p data-start=\"799\" data-end=\"817\"><strong data-start=\"799\" data-end=\"817\">Indirect light</strong></p>\r\n</li><li data-start=\"818\" data-end=\"861\">\r\n<p data-start=\"820\" data-end=\"861\"><strong data-start=\"820\" data-end=\"861\">Well-draining bark or moss-based soil</strong></p>\r\n</li><li data-start=\"862\" data-end=\"900\">\r\n<p data-start=\"864\" data-end=\"900\"><strong data-start=\"864\" data-end=\"900\">Humidity and occasional watering</strong></p>\r\n</li></ul>\r\n<p data-start=\"902\" data-end=\"1015\">With a little care, an orchid can bloom for weeks — sometimes months — bringing elegance and beauty to any space.</p><p data-start=\"902\" data-end=\"1015\"><img style=\"width: 100%; float: left;\" src=\"https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fcdn.mos.cms.futurecdn.net%2FEmsd2VN7PUxTEAoGiEoZs.jpg&amp;f=1&amp;nofb=1&amp;ipt=227e70be603ad4f7bb5146625377dc456165b669c48d2bd100d3028ef56351ee\" class=\"note-float-left\"></p>', 4, 787, 0, 0, 1, 'jpg', '2025-04-24 16:13:26', '2025-05-21 19:22:36');
INSERT INTO `article` (`id`, `public_id`, `user_id`, `title`, `description`, `content`, `category`, `price`, `bought`, `likes_count`, `is_public`, `cover_extension`, `created_at`, `updated_at`) VALUES
(9, '6f3477ff-3670-11f0-bfd5-309c233d53c1', 4, 'Tales of The Underworld', 'A short article about my game.', '<h1><b>Descend Into the Underworld</b></h1><p data-start=\"201\" data-end=\"522\"><strong data-start=\"201\" data-end=\"230\"><em data-start=\"203\" data-end=\"228\">Tales of the Underworld</em></strong> is a short 2D puzzle-platformer that blends atmospheric minimalism with mind-bending mechanics. Set in a stark world of <img style=\"width: 25%; float: right;\" src=\"data:image/png;base64,\" data-filename=\"Screenshot 2025-04-13 003324.png\" class=\"note-float-right\">black, white, and gray, every room you explore is a challenge to both your reflexes and your perception. But this isn\'t just about jumping — it\'s about shifting reality.</p>\r\n<p data-start=\"524\" data-end=\"842\">Equipped with gravity-altering boots and a quantum cloak that lets you phase through select walls, you\'re tasked with solving increasingly complex puzzles in a mysterious underground facility. As you uncover what happened, the line between environment and challenge blurs — and each mechanic becomes a key to survival.</p><h1 data-start=\"524\" data-end=\"842\">Think in Layers, Move in Dimensions</h1><p data-start=\"893\" data-end=\"1240\">Physics-based systems drive the core of the game. Boxes fall, shift, and slide based on gravity and momentum. Doors only open when plates are pressed — by you, or cleverly moved objects. Platforms don\'t just move; they obey gravity too. And with each new area, jump variants evolve, requiring players to rethink how they approach space and motion.</p>\r\n<p data-start=\"1242\" data-end=\"1486\">You\'ll find secrets tucked into hard-to-reach corners, collectibles hidden behind clever challenges, and checkpoints placed just enough to keep frustration low but tension high. It\'s a compact experience — but one packed with interactive depth.</p><h1 data-start=\"1242\" data-end=\"1486\">Built in Godot with Accessibility in Mind</h1><p data-start=\"1543\" data-end=\"1949\">Created entirely in <strong data-start=\"1563\" data-end=\"1574\">Godot 4</strong>, the game uses custom shaders and lightweight post-processing to deliver clean, readable visuals while staying fast and mobile-friendly. Contrast, brightness, and bloom can be adjusted at any time. Color inversion — a core visual mechanic — can also be turned off for comfort. The game ensures that important objects are always readable and never lost in background clutter.</p>\r\n<p data-start=\"1951\" data-end=\"2181\">Whether you’re exploring the level design or reading between the lines of its quiet story, <strong data-start=\"2042\" data-end=\"2069\">Tales of the Underworld</strong> delivers a focused and polished platforming experience that plays with physics, perception, and player control.</p><h1><img style=\"width: 100%;\" src=\"data:image/png;base64,\" data-filename=\"Screenshot 2025-04-12 234612.png\"><br></h1>', 2, 1200, 0, 0, 1, 'png', '2025-05-21 21:21:17', '2025-05-21 19:08:57');
INSERT INTO `article` (`id`, `public_id`, `user_id`, `title`, `description`, `content`, `category`, `price`, `bought`, `likes_count`, `is_public`, `cover_extension`, `created_at`, `updated_at`) VALUES
(10, 'ba5c0b16-3675-11f0-bfd5-309c233d53c1', 4, 'Worms: The Hidden Helpers Beneath Our Feet', 'Test Article', '<p><p></p><h1 class=\"page_title\" align=\"left\">Why Worms Matter</h1>Worms, especially earthworms, play a vital role in keeping our soil healthy.</p><p><img style=\"width: 25%; float: right;\" src=\"https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fres.cloudinary.com%2Fdk-find-out%2Fimage%2Fupload%2Fq_80%2Cw_1920%2Cf_auto%2FDCTM_Penguin_UK_DK_AL645784_zcau0r.jpg&amp;f=1&amp;nofb=1&amp;ipt=cf5c747948d06673d3a5f78f9a5ad10123ea7f270b1429c8bf8d404b6488940e\" class=\"note-float-right\"> As they wiggle through the ground, they eat dead leaves and other natural waste. This process breaks down the material and turns it into rich compost that helps plants grow. <p>Their movement also creates small tunnels in the soil, which improves airflow and lets water and nutrients reach plant roots more easily.</p><h1>Nature’s Tiny Farmers</h1><p>The waste worms leave behind—called castings—is full of nutrients. This makes it an excellent natural fertilizer. Gardeners often rely on worms to boost soil health without chemicals. Worms may be small and simple, but their daily work supports the entire ecosystem. Without them, many plants would struggle to survive, and soil would lose its life-giving qualities.</p><p></p></p>', 5, 1000, 0, 0, 1, 'jpeg', '2025-05-21 21:59:11', '2025-05-21 19:03:50');

